import React from 'react'
import footerImg from "../assets/DH.png"

const footerImage = {
  maxWidth: '200px',
  padding: "0.8rem",
  margin: 0,
}

const Footer = () => {
  return (
    <footer>
        <p>Powered by</p>
        {/* <img src="public/images/DH.png" alt='DH-logo' /> */}
        <img src={footerImg} alt='DH-logo' style={footerImage}/>
    </footer>
  )
}

export default Footer
